window.bookSummaryJSON = "<p>Someone is poisoning San Francisco's foodies. Tony Mandolin, the fog city's only Private Eye with a view into the supernatural, has been retained to find out whom and why. </p> <p>Unfortunately, this brings him to the attention of Medb, the Queen of the Unseelie Court and it seems that Tony's only hope of survival lies in the hands of Landau Bain, the alcoholic wizard, and Bain is cranky.</p> <p>Performed by Bradley Smith, Elliot Dash, Andy Brownstein, Dani Stoller, Patrick Bussink, Eric Messner, Todd Scofield, Nora Achrati, Andy Clemence, Karen Novack, Yasmin Tuazon, Kimberly Gilbert, Scott McCormick, Matthew Keenan, Zeke Alton, David Jourdan, Christopher Walker, Gregory Linington, Ken Jackson, Colleen Delany, Katy Carkuff, Thomas Keegan, Jacob Yeh, Terence Aselford, Lolita Horne, Richard Rohan.</p>"; 
